import './App.css';
import CategoryList from './components/CategoryList';

import Header from './components/Header';

function App() {
  return (
    <div>
      <Header/> 
      <Routes>
          <Route path="/" element={<CategoryList/>} />
        </Routes>
    </div>
  );
}

export default App;
